//create a copy of a default map. used for isntanced map. version is usually player name
cloneMap = function(model,version){
	var newname = model + '~' + version;
	mapList[newname] = {};
	mapList[newname].name = mapList[model].name;
	mapList[newname].grid = mapList[model].grid;
	mapList[newname].model = model;
	defaultMapMod[newname] = {};
	convertMapId[newname] = model;  
	
	mapList[model].load(newname);
	return newname;
}



